import React from "react";
import "./SearchItem.css";

const SearchItem = () => {
  return (
    <div className="searchItem">
      <img
        src="https://t-cf.bstatic.com/xdata/images/hotel/square600/44146554.webp?k=bc461f3aff9a66c15ddae3b3a7e10a44f6aea550cb89ce292cec7ca0b4ccecdb&o=&s=1"
        alt=""
        className="siImg"
      />
      <div className="siDesc"></div>
      <div className="siDe"></div>
    </div>
  );
};

export default SearchItem;
